import React, { useEffect, useState } from 'react';
import {
  Container,
  Typography,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  Button,
  Slider,
  Box,
  TextField,
  Stack
} from '@mui/material';
import DeviceAnalytics from './DeviceAnalytics';

function App() {
  const [devices, setDevices] = useState([]);
  const [openDialog, setOpenDialog] = useState(false);
  const [selectedDevice, setSelectedDevice] = useState(null);

  useEffect(() => {
    fetch('http://localhost:5001/api/devices')
      .then(res => res.json())
      .then(setDevices)
      .catch(err => console.error('Error fetching devices:', err));
  }, []);

  const handleOpenDialog = (device) => {
    setSelectedDevice(device);
    setOpenDialog(true);
  };

  const handleCloseDialog = () => {
    setOpenDialog(false);
    setSelectedDevice(null);
  };

  const handleSliderChange = (field, value) => {
    const updatedDevice = {
      ...selectedDevice,
      [field]: [...selectedDevice[field], value]
    };
    // Update local state
    setDevices(devices.map(d => d.Did === selectedDevice.Did ? updatedDevice : d));
    // Push update to the server
    updateDeviceData(updatedDevice);
  };

  const updateDeviceData = (device) => {
    fetch(`http://localhost:5001/api/devices/${device.Did}`, {
      method: 'PUT',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify(device),
    })
    .then(response => response.json())
    .then(() => console.log('Device updated successfully'))
    .catch(error => console.error('Error updating device:', error));
  };

  const handleAddDevice = () => {
    if (!newDevice.Did) {
      alert("Please fill in all required fields.");
      return;
    }
    fetch('http://localhost:5001/api/devices', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({...newDevice, waterFlow: [newDevice.waterFlow], pressure: [newDevice.pressure], temperature: [newDevice.temperature]}),
    })
    .then(response => response.json())
    .then(data => {
      setDevices([...devices, data]);
      handleCloseDialog();
    })
    .catch(error => {
      console.error('Error adding new device:', error);
      alert('Failed to add device: ' + error.message);
    });
  };

  return (
    <Container maxWidth="md">
      <Typography variant="h4" sx={{ mt: 4, mb: 2 }}>Water Management System</Typography>
      <Button variant="contained" sx={{ mb: 2 }} onClick={() => handleOpenDialog({Did: '', waterFlow: [], pressure: [], temperature: []})}>
        Add Device
      </Button>
      <TableContainer component={Paper}>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>Device ID</TableCell>
              <TableCell>Latest Water Flow</TableCell>
              <TableCell>Latest Pressure</TableCell>
              <TableCell>Latest Temperature</TableCell>
              <TableCell>Edit</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {devices.map((device) => (
              <TableRow key={device.Did}>
                <TableCell>{device.Did}</TableCell>
                <TableCell>{device.waterFlow.slice(-1)[0]}</TableCell>
                <TableCell>{device.pressure.slice(-1)[0]}</TableCell>
                <TableCell>{device.temperature.slice(-1)[0]}</TableCell>
                <TableCell>
                  <Button onClick={() => handleOpenDialog(device)}>Edit</Button>
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
      <Dialog open={openDialog} onClose={handleCloseDialog} fullWidth maxWidth="sm">
        <DialogTitle>{selectedDevice ? 'Edit Device Data' : 'Add New Device'}</DialogTitle>
        <DialogContent>
          <TextField
            autoFocus
            margin="dense"
            label="Device ID"
            type="text"
            fullWidth
            variant="standard"
            value={selectedDevice ? selectedDevice.Did : ''}
            onChange={(e) => setSelectedDevice({...selectedDevice, Did: e.target.value})}
          />
          <Box sx={{ mt: 2, mb: 1 }}>
            <Typography>Water Flow (L/s)</Typography>
            <Slider
              value={selectedDevice && selectedDevice.waterFlow.slice(-1)[0] || 0}
              onChange={(e, val) => handleSliderChange('waterFlow', val)}
              min={0}
              max={100}
              step={1}
            />
          </Box>
          <Box sx={{ mt: 2, mb: 1 }}>
            <Typography>Pressure (psi)</Typography>
            <Slider
              value={selectedDevice && selectedDevice.pressure.slice(-1)[0] || 0}
              onChange={(e, val) => handleSliderChange('pressure', val)}
              min={0}
              max={200}
              step={1}
            />
          </Box>
          <Box sx={{ mt: 2, mb: 1 }}>
            <Typography>Temperature (Â°C)</Typography>
            <Slider
              value={selectedDevice && selectedDevice.temperature.slice(-1)[0] || 0}
              onChange={(e, val) => handleSliderChange('temperature', val)}
              min={-20}
              max={50}
              step={1}
            />
          </Box>
        </DialogContent>
        <DialogActions>
          <Button onClick={handleCloseDialog}>Cancel</Button>
          <Button onClick={handleAddDevice} color="primary">
            {selectedDevice ? 'Update' : 'Add'}
          </Button>
        </DialogActions>
      </Dialog>
      {devices.map(device => (
        <DeviceAnalytics key={device.Did} deviceId={device.Did} />
      ))}
    </Container>
  );
}

export default App;
